                b=b-(c/2);
            }
        }
        if(b/2>0&&a>0)
        {
            if(b/2>=a)
            {
                n=n+a*3;
                a=0;
            }
            else
            {
                n=n+(b/2)*3;
                a=a-(b/2);
            }
        }
        printf("%d\n",n);
        n=0;
    }
    return 0;
}
