['#include <stdio.h>
 
int testCases,a,b,c,sum;


void firstopt ()
{
	a--;
	b-=2;
}

void secondopt ()
{
	b--;
	c-=2;
}

int max ()
{
	return a > b ? (a > c ? a : c) : b > c ? b : c; 
}

int main ()
{
 
	//freopen ("cf.in","r",stdin),freopen("cf.out","w",stdout);
	scanf ("%d",&testCases);
	while (testCases--)
	{
		scanf ("%d %d %d",&a,&b,&c);
		sum = a + b + c;
		label:
		if (a==b&&b==c)
		{
			printf ("%d\n",b*3/2+b*3/4);
			continue;
		}
		else if (max()==c&&b>=1)
		{
			while (b>=1&&c>=2) secondopt ();
		}
		else if (max()==a&&b>=2)
		{
			while (a>=1&&b>=2) firstopt();
		}
		else if (max()==b&&a>=1||max()==b&&c>=2)
		{
			while (a>=1&&b>=2) firstopt();
			while (b>=1&&c>=2) secondopt ();
		}
		
		if ((a>=1&&b>=2)||(b>=1&&c>=2))
			goto label;
		//printf ("a = %d b = %d c = %d\n",a,b,c);
		printf ("%d\n",sum-a-b-c);
	}
}']

