['//Codeforces Problem Set 1236A

#include<stdio.h>

int min(int, int);
int max_stones(int, int, int);

int main()
{
	int test_cases;
	scanf("%d", &test_cases);
	int heap1, heap2, heap3, alice_stones;
	while (0<test_cases--)
	{
		scanf("%d %d %d", &heap1, &heap2, &heap3);
		alice_stones = max_stones(heap1, heap2, heap3);
		printf("%d\n", alice_stones);
	}
	return 0;
}

int max_stones(int heap1, int heap2, int heap3)
{
	int stones = 0;
	int operation1, operation2;
	operation2 = min(heap3/2, heap2);
	heap2 -= operation2;
	operation1 = min(heap2/2, heap1);
	stones = 3 * (operation1 + operation2);
	return stones;
}

int min(int num1, int num2)
{
	if (num1<num2)
	{
		return num1;
	}
	return num2;
}
