['#include<stdio.h>

typedef long long LL;
const LL mod=1e9+7;

LL fpow(LL p){
	LL ret=1, base=2;
	while(p){
		if(p&1) ret=(ret*base)%mod;
		base=(base*base)%mod;
		p>>=1;
	}
	return ret;
}

int main(){
	LL n, m;
	scanf("%I64d %I64d", &n, &m);
	printf("%I64d\n", (fpow(n*m)-(n*(fpow(m*(n-1))-fpow(n-1)+1)+fpow(n)-n-1)+mod)%mod);
	return 0;
}
