	if(n == 0)
		return 1;
	li result = exponenciacao(a%1000000007, n/2)%1000000007;
	result = (result*result)%1000000007;
	if(n%2 == 1)
		result = (result%1000000007)*(a%1000000007);
	return result%1000000007;

}

