['#include<stdio.h>

long long int mod = 1e9 + 7;

long long int calc_pack(long long int x, long long int y){
  long long int res = 1;
  x = x % mod;

  while (y > 0){
    if(y % 2 == 1){
      res = (res * x) % mod;
    } 
    y = y/2;
    x = (x*x) % mod;
  }
  return res;
}

int main(){   
  long long int n, m;
  scanf("%lld %lld",&n,&m);

  long long int temp = calc_pack(2, m) - 1;
  long long int result = (calc_pack(temp, n)) % mod;

  printf("%lld\n", result);
  return 0;
}
