['#include <stdio.h>

long int power (long int base, long int exp) {
	if (exp == 0) return 1;
	if (exp%2 == 1) return (base * power(base, exp-1))%1000000007;
	long int temp = power(base, exp/2);
	return (temp*temp)%1000000007;
}
long long int myPow (long long int a, long long int n) {
    if (n == 0) return 1;
    if (n%2 == 1) return (a*myPow(a, n-1))%1000000007;
    long long int x = myPow(a, n/2);
    return (x*x)%1000000007;
}
int main () {
	long int n, m;
	scanf("%ld%ld", &n, &m);
	printf("%ld", myPow(myPow(2, m) - 1, n));
}
