int max_stone(int a,int b,int c) {
	int arr[a+1][b+1][c+1],i,j,k;

	for(i=0;i<=a;i++) {
		for(j=0;j<=b;j++) {
			for(k=0;k<=c;k++) {
				 if(j==0) {
			    	 arr[i][j][k]=0;
			    	}
				else if(i==0)  {
					if(j>=1&&k>=2)
					arr[i][j][k]=arr[i][j-1][k-2]+3;
					else arr[i][j][k]=0;
					}
			    else if(i>=1&&j>=2&&k>=2) {
			    	arr[i][j][k]=max(arr[i-1][j-2][k],arr[i][j-1][k-2])+3;
			    	}
			    else if(j>=1&&k>=2) {
			    	arr[i][j][k]=arr[i][j-1][k-2]+3;
			    	}
			    else if(i>=1&&j<=2) {
			    	arr[i][j][k]=arr[i-1][j-2][k]+3;
			    	}
			    else arr[i][j][k]=0;
			    //printf("arr[%d][%d][%d] is %d \n",i,j,k,arr[i][j][k]);
			}
		}
	}
