['#include <stdio.h>

#define M 1000000007
long long int bigmod(long long int  x, long long int n)
{
    long long int result=1;
    while(n)
    {
        if(n&1)
            result = (result*x)%M;
        x = (x*x)%M;
        n /= 2;
    }
    return result;
}
int main()
{
    long long n, m, ans;
    scanf("%lld%lld",&n, &m);
    
    ans = bigmod(2,m)-1;
    ans %= M;
    ans = bigmod(ans,n);
    ans %= M;
    
    printf("%lld\n", ans);
    
    return 0;
}
']

