const int mod=1e9+7;

long long int powof(long long int p,long long int n)
{
	if(n==0) return 1;
	if(n%2==0)
		return powof(((p%mod)*(p%mod))%mod,n/2)%mod;
	else
		return ((p%mod)*(powof(((p%mod)*(p%mod))%mod,(n/2)%mod)%mod))%mod;
}

int main()
{
	long long int n,m,ans=1,p=1;
	scanf("%lld %lld",&n,&m);
	p=powof(2,m)-1;
        //printf("2^m-1=%ld\n",p);	
	ans=powof(p,n);
	if(n==0)
	{
		printf("0\n");
		return 0;
	}
	printf("%lld\n",ans);

	return 0;
}

