['#include <stdio.h>
 
#define MD	1000000007
 
long long power(int a, int k) {
	long long p;
 
	if (k == 0)
		return 1;
	p = power(a, k / 2);
	p = p * p % MD;
	if (k % 2)
		p = p * a % MD;
	return p;
}
 
int main() {
	int n, m;
 
	scanf("%d%d", &n, &m);
	printf("%lld\n", power(power(2, m) - 1, n));
	return 0;
}']

['#include <stdio.h>
#include <math.h>

long long int exponencial(long long int base, long long int exp)
{
    long long int t = 1;
    long n =  1000000007;
    while(exp > 0){
        if(exp % 2 != 0){
            t = (t*base) % n;
        }
        base = (base*base) % n;
        exp /= 2;
    }
    return t % n;
}

int main()
{
    long long int n, m;
    scanf("%lld %lld", &n, &m);
    printf("%lld", (exponencial(2, n)*m)+1);

    return 0;
}
