['#include<stdio.h>
typedef long long ll;
const long long inf=1e9+7;
ll qpow(ll a,ll b)
{
	ll h=a,ans=1;
	while(b)
	{
		if(b&1)ans=(ans*h)%inf;
		h=(h*h)%inf;
		b>>=1;
	}
	return ans;

}
int main()
{
	ll m,n,t,ans;
	while(scanf("%lld %lld",&m,&n)!=EOF)
	{
		t=qpow(2,n)-1;
		ans=qpow(t,m);
		printf("%lld",ans); 
		printf("\n");
	}
	return 0;
}
