int contador(int a, int b, int c, int resultado){
        if(b == 0)
            return resultado;
        else if(a == 0 && c == 0)
            return resultado;
        else{
            if(a+b > b+c && a > 0 && b > 1)
                return contador(a-1, b-2, c, resultado+3);
            else if(b+c >= a+b && b > 0 && c > 1)
                return contador(a, b-1, c-2, resultado+3);
            else if(a > 0 && b > 1)
                return contador(a-1, b-2, c, resultado+3);
            else if(b > 0 && c > 1)
                return contador(a, b-1, c-2, resultado+3);
            else
                return resultado;
        }
}

