#include <math.h>
const int mod = (1E+9) + 7;
typedef long long ll;
ll fpow(ll x, ll y);
int main()
{
	int n, m;
	scanf("%d %d", &n, &m);
	ll sum = fpow(2, m);
	sum = (sum - 1 +mod) % mod;
	sum = fpow(sum, n);
	printf("%d\n", sum);
	return 0;
} 
ll fpow(ll x, ll y)
{
	ll ret = 1;
	while (y)
	{
		if (y % 2 != 0) ret = (ret * x) % mod;
		y /= 2;
		x = x *x % mod;
	}
	return ret;
}']

