['#include<stdio.h>
int dp[101][101][101];
int solve(int a, int b, int c, int sum);
int maxWork(int a, int b);
void initDp();
int main()
{
	//freopen("input.txt", "r", stdin);
	int k, t, a, b, c;
	scanf("%d", &t);
	for (k = 1; k <= t; k++)
	{
		scanf("%d %d %d", &a, &b, &c);
		initDp();
		printf("%d\n", solve(a, b, c, 0));
	}
	return 0;
}
int solve(int a, int b, int c, int sum)
{
	int left = 0, right = 0;
	if (dp[a][b][c] != -1)
		return dp[a][b][c];
	if (!(a >= 1 && b >= 2) && !(b >= 1 && c >= 2))
		return sum;
	if (a >= 1 && b >= 2)
		left = solve(a - 1, b - 2, c, sum + 3);
	if (b >= 1 && c >= 2)
		right = solve(a, b - 1, c - 2, sum + 3);
	return dp[a][b][c] = maxWork(left, right);
}
int maxWork(int a, int b)
{
	if (a >= b)
		return a;
	return b;
}
void initDp()
{
	int i, j, k;
	for (i = 0; i < 101; i++)
		for (j = 0; j < 101; j++)
			for (k = 0; k < 101; k++)
				dp[i][j][k] = -1;
}']

