{
	unsigned long long int result = 1, val = 1000000007;
	while (1)
	{
		if (countx > 63)
		{
			countx -= 63;
			result *= powerWork(2, 63) % val;
			result %= val;
		}
		else
		{
			result *= powerWork(2, countx) % val;
			result %= val;
			break;
		}
	}
	return result;
}
unsigned long long int powerWork(int b, int p)
{
	unsigned long long int i, temp = 1;
	for (i = 1; i <= p; i++)
		temp *= b;
	return temp;
}
