['#include <stdio.h>

const long long MOD = 1e9 + 7;

long long my_pow(long long x, long long p) {
	long long y = 1;
	int n = 0;
	while (p >> n != 0)
	{
		++n;
	}
	while (n > 0)
	{
		--n;
		y = y * y % MOD;
		if ((p >> n) & 1)
			y = y * x % MOD;
	}
	return y;
}

int main()
{
	long long n, m;
	scanf("%I64d %I64d", &n, &m);
	printf("%I64d\n", my_pow(my_pow(2, m) - 1, n));
	return 0;
}']

