['#include<stdio.h>
void operation(int *a , int *b,int *sum)
{
    int num=(*b)/2;
    if(num>*a)
    {
        (*sum)+=(*a)*3;
        (*b)=(*b)-((*a)*2);
        (*a)=0;
    }
    else
    {
        (*sum)+=(num*3);
        (*b)=(*b)-(num*2);
        (*a)=(*a)-num;
    }
    //printf("\n%d",*sum);
}
int main()
{
    int T ,a,b,c,sum,s;
    scanf("%d",&T);
    while(T--)
    {
        sum=0;
        scanf("%d",&a);
        scanf("%d",&b);
        scanf("%d",&c);
        if(b>c)
            {
                operation(&a,&b,&sum);
                operation(&b,&c,&sum);
            }
        else
            {
                operation(&b,&c,&sum);
                operation(&a,&b,&sum);
            }

        printf("%d\n",sum);      
    }
    return 0;
}
