	int anss=1;
	for(;y;y>>=1){
		if(y&1)anss=1LL*anss*x%mod;
		x=1LL*x*x%mod;
	}
	return anss;
}
int ans,n,m;
int main()
{
	scanf("%d%d",&n,&m);
	int base=ksm(2,m);
	base=(base-1+mod)%mod;
	ans=ksm(base,n);
	printf("%d",ans);
	return 0;
}']

