	int n,m;scanf("%d %d",&n,&m);
	int rm;

	for(int i=0;i<1000;i++){
		HELPISLA <<= 1;
		HELPISLA %= MODO;
	}
	for(rm=0;rm+1000<m;rm+=1000){
		NUM*=HELPISLA;
		NUM%=MODO;
	}
	for(;rm<m;rm++){
		NUM<<=1;
		NUM%=MODO;
	}
	NUM--;
	ANS = NUM;
	NUM10 = 1;
	for(int i=0;i<1000;i++){
		NUM10 *= NUM;
		NUM10 %= MODO;
	}

	rm = 0;
	for(rm=0;rm+1000<n-1;rm+=1000){
		ANS *= NUM10;
		ANS %= MODO;
	}
	for(;rm<n-1;rm++){
		ANS *= NUM;
		ANS %= MODO;
	}
