['#include<stdio.h>
int max(int k,int l)
{
    if(k>l)
    return k;
    else 
    return l;
}
int fun(int a,int b,int c)
{
    int dp[a+1][b+1][c+1];
    int i,j,k;
    dp[0][0][0]=0;
    for(k=1;k<=c;k++)
    dp[0][0][k]=0;
    for(j=1;j<=b;j++)
    dp[0][j][0]=0;
    for(i=1;i<=a;i++)
    dp[i][0][0]=0;
    for(j=1;j<=b;j++)
    {
        for(k=1;k<=c;k++)
        {
            if(j>=1&&k>=2)
            dp[0][j][k]=3+dp[0][j-1][k-2];
            else
            dp[0][j][k]=0;
        }
    }
    for(i=1;i<=a;i++)
    {
        for(j=1;j<=b;j++)
        {
            if(i>=1&&j>=2)
            dp[i][j][0]=3+dp[i-1][j-2][0];
            else
            dp[i][j][0]=0;
        }
    }
    for(i=1;i<=a;i++)
    {
        for(k=1;k<=c;k++)
        {
            dp[i][0][k]=0;
        }
    }
    for(i=1;i<=a;i++)
    {
        for(j=1;j<=b;j++)
        {
            for(k=1;k<=c;k++)
            {
                if(j>=2&&k<2)
                dp[i][j][k]=3+dp[i-1][j-2][k];
                else if(j<2&&k>=2)
                dp[i][j][k]=3+dp[i][j-1][k-2];
                else if(j>=2&&k>=2)
                dp[i][j][k]=max(3+dp[i-1][j-2][k],3+dp[i][j-1][k-2]);
                else
                dp[i][j][k]=0;
            }
        }
    }
    return dp[a][b][c];
    
    
}
int main()
{
    int t,i;
    scanf("%d",&t);
    int a[t],b[t],c[t],r[t];
    for(i=0;i<t;i++)
    {
        scanf("%d%d%d",&a[i],&b[i],&c[i]);
        r[i]=fun(a[i],b[i],c[i]);
    }
    for(i=0;i<t;i++)
    {
        printf("%d\n",r[i]);
    }
}']

