['#include "stdio.h"

#define M 1000000007

int Pow(int x, int n)
{
    if(n==1) return x;
    int t = Pow(x, n>>1);
    if(n&1) return (int)(t*1ll*t%M*x%M);
    else return (int)(t*1ll*t%M);
}

int main()
{
    int n, m, ans;
    scanf("%d%d", &n, &m);
    ans = Pow( Pow(2, m)-1, n);
    printf("%d\n", ans);
    return 0;
}
