['#include <stdio.h>
#define lint long long

const int P = 1e9 + 7;

lint f(lint n, lint k) {
	lint ret = 1;
	while (k) {
		if (k & 1) ret = ret * n % P;
		n = n * n % P;
		k >>= 1;
	}
	return ret;
}

int main()
{
	int n, m;
	scanf("%d%dd", &n, &m);
	lint ans = f(2, m) - 1;
	ans = f(ans, n);
	if (ans < 0) ans += P;
	printf("%d", ans);
}']

