['#include <stdio.h>
long long BP(long long a, long long b, long long p)
{
	long long R = 1;
	while (b)
	{
		if (b & 1)
		{
			R *= a;
			R %= p;
		}
		a *= a;
		a %= p;
		b >>= 1;
	}
	return R;
}
int main()
{
	long long n, m;
	long long R;
	scanf("%I64d %I64d", &n, &m);
	R = BP(BP(2, m, 1000000007) - 1, n, 1000000007);
	printf("%I64d", R);
	return 0;
}']

