['#include <stdio.h>

typedef long long int ll;
ll modulo(ll b, ll e)
{
    ll m = (ll)1e9 + 7;
    long long int rem = b % m, remainder = 1;
    //(b^e)%m
    while (e)
    {
        if (e & 1)
        { //e%2==1
            remainder = rem * remainder;
            remainder %= m;
        }
        rem *= rem;
        rem %= m;
        e = e >> 1; //e/=2
    }

    return remainder;
}

int main()
{
    ll n, m;
    scanf("%lld %lld", &n, &m);
    ll exp1 = modulo(2, m);
    exp1 = (exp1 + (1000000006)) % 1000000007;
    ll exp2 = modulo(exp1, n);
    printf("%lld\n", exp2);
}']

