['#include<stdio.h>

#define MOD 1000000007

int mul(int a, int b){
  return (a*1ll*b)%MOD;
}

int powmod(int b, int p){
  int t = 1;
  while(p){
    if(p&1) t = mul(t, b);
    b = mul(b, b);
    p >>= 1;
  }
  return t;
}

int main(){
  int n, m;
  scanf("%d %d", &n, &m);
  int x = (powmod(2, m) + MOD - 1)%MOD;
  printf("%d\n", powmod(x, n));
  return 0;
}
