['#include<stdio.h>
long long int modpow(long long int a, long long int n, long long int p)
{
	if (n < 0)return 0;
	long long int res = 1;
	while (n > 0)
	{
		if (n % 2 == 1)
			res = res * a % p;
		n /= 2;
		a = a * a % p;
	}
	return res;
}
int main()
{
	long long int n, m;
	scanf("%lld %lld", &n, &m);
	long long int p = 1000000007;
	long long int ans;
	ans = (modpow(2, m, p) - 1 + p) % p;
	ans = modpow(ans, n, p);
	printf("%lld\n", ans);
	return 0;
}']

