#include<math.h>
using namespace std;
long long ans;
int maa = 1000000007;
long long cc(int mm)
{
	long long kk=1;
	for (int i = mm-1; i >= mm/2+1; i--)
	{
		kk = 1;
		for (int j = mm; j >= i+1; j--)
		{
			kk = kk * j / (mm - j + 1)%maa;
			ans = (ans + kk) % maa;
		}
	}
	ans = ans * 2 % maa;
	if (mm % 2 == 0)
	{
		for (int j = mm; j >= mm/2+1; j--)
		{
			kk = kk * j / (mm - j+1) % maa;
			ans = (ans + kk) % maa;
		}
	}
	return ans+1;
}

int main()
{
	int n,m;
	cin >> n >> m;
	long long kl=cc(m);
	for (int i = 1; i < n; i++)
	{
		kl = kl * kl % maa;
	}
	cout << kl;
	return 0;
}']

