['#include <stdio.h>
#include <stdlib.h>
#include <limits.h>
#include <ctype.h>

enum {
    BRD = 1000000007
};

unsigned long long count1(int n) {
    unsigned long long res = 1;
    int temp = n % 32;
    n -= n % 32;
    for (int i = 0; i < n; i += 32) {
        res <<= 32;
        res %= BRD;
    }
    for (int i = 0; i < temp; i++) {
        res <<= 1;
        res %= BRD;
    }
    return res;
}
int
main(void)
{
    int n, m;
    scanf("%d%d", &n, &m);
    unsigned long long res1 = count1(n * m), res2 = count1(n) - 1, res3 = count1((n - 1) * (m - 1));
    if (n != 1) {
        res1--;
    }
    res1 = res1 - res2 * res3;
    printf("%llu\n", res1);
    return 0;
}']

