				b-=1;
				c-=2;
				ans+=3;
				if(b<1)
					break;
				if(c<2)
					break;
				if(b>=1&&c>=2)
					continue;
			}
		}
		if(b>1&&c<2)
			if(a>=1)
			{
				for(;;)
				{
					a-=1;
					b-=2;
					ans+=3;
					if(a<1)
						break;
